import * as React from 'react';
import { Box, AppBar, Toolbar, IconButton, Typography, Menu, Container, Avatar, Button, Tooltip, MenuItem, Divider, Stack, useMediaQuery } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import ExploreIcon from '@mui/icons-material/Explore';
import StorefrontRoundedIcon from '@mui/icons-material/StorefrontRounded';
import Groups2RoundedIcon from '@mui/icons-material/Groups2Rounded';
import { Link, useNavigate, Outlet } from 'react-router-dom'
import './AppBar.css'

const pages = ['Discover', 'Market place', 'Clubs'];
const settings = ['Profile', 'Account', 'Dashboard', 'Logout'];

function ResponsiveAppBar(props) {
    const isMobile = useMediaQuery((theme) => theme.breakpoints.down('sm'));

    return (
        <React.Fragment>
            {isMobile ? <MobileAppBar /> : <DesktopAppBar />}
        </React.Fragment>
    );
}

function MobileAppBar() {
    const [anchorElNav, setAnchorElNav] = React.useState(null);

    const handleOpenNavMenu = (event) => {
        setAnchorElNav(event.currentTarget);
    };

    const handleCloseNavMenu = () => {
        setAnchorElNav(null);
    };

    return (
        <AppBar position="static" sx={{ backgroundColor: '#ffffff' }} elevation={0}>
            <Container maxWidth="xl" sx={{ border: "0px solid black", pt: '0px' }}>
                <Box>
                    <Toolbar disableGutters >
                        <Typography
                            variant="h4"
                            noWrap
                            component="a"
                            href="/"
                            sx={{
                                flexGrow: 1,
                                mr: 2, display: 'flex', fontFamily: 'Open Sans', fontWeight: 900, letterSpacing: '.1.5rem',
                                color: '#768A54',
                                textDecoration: 'none'
                            }}
                        >
                            <img src=".\susita_logo_name.png" width={'150px'} height='auto' />
                        </Typography>
                        <IconButton
                            size="large"
                            aria-label="account of current user"
                            aria-controls="menu-appbar"
                            aria-haspopup="true"
                            onClick={handleOpenNavMenu}
                            color="inherit"
                        >
                            <MenuIcon />
                        </IconButton>
                        <Menu
                            id="menu-appbar"
                            anchorEl={anchorElNav}
                            anchorOrigin={{
                                vertical: 'bottom',
                                horizontal: 'left',
                            }}
                            keepMounted
                            transformOrigin={{
                                vertical: 'top',
                                horizontal: 'left',
                            }}
                            open={Boolean(anchorElNav)}
                            onClose={handleCloseNavMenu}
                        >
                            {pages.map((page) => (
                                <MenuItem key={page} onClick={handleCloseNavMenu}>
                                    <Typography sx={{ color: '#626262' }} textAlign="center">{page}</Typography>
                                </MenuItem>
                            ))}
                        </Menu>
                    </Toolbar>
                </Box>
            </Container>
        </AppBar>
    );
}

function DesktopAppBar() {
    const joinNowButtonRef = React.useRef(null);
    const [anchorElUser, setAnchorElUser] = React.useState(null);

    const handleOpenUserMenu = (event) => {
        setAnchorElUser(event.currentTarget);
    };

    const handleCloseUserMenu = () => {
        setAnchorElUser(null);
    };

    const navigateTo = () => {
        const navigateTo = () => {
            return <div><p>TEST</p></div>
        }

        return (
            <AppBar position="static" sx={{ backgroundColor: '#ffffff' }} elevation={0}>
                <Container maxWidth="xl" sx={{ border: "0px solid black", pt: '0px' }}>
                    <Box>
                        <Toolbar disableGutters>
                            <Typography
                                variant="h4"
                                noWrap
                                component="a"
                                href="/"
                                sx={{
                                    mr: 2, display: { md: 'flex' }, fontFamily: 'Open Sans', fontWeight: 900, letterSpacing: '.1.5rem',
                                    color: '#768A54',
                                    textDecoration: 'none'
                                }}
                            >
                                <img src=".\susita_logo_name.png" width={'150px'} height='auto' />
                            </Typography>
                            <Box sx={{ justifyContent: 'flex-end', marginRight: '5%', flexGrow: 1, display: { md: 'flex' } }}>
                                <Stack direction="row" spacing={2} sx={{ p: '5px' }}>

                                    <IconButton sx={{ p: '5px', height: '40px', color: '#686869' }}>
                                        <Box sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
                                            <ExploreIcon sx={{ width: '25px', height: 'auto' }} />
                                            <Typography
                                                sx={{
                                                    '&:hover': { color: 'black' },
                                                    fontSize: 13.5, color: '#686869', fontFamily: 'Open Sans', fontWeight: 300,
                                                    letterSpacing: '.0.5rem', textTransform: 'none'
                                                }}>
                                                Discover
                                            </Typography>
                                        </Box>
                                    </IconButton>
                                    <IconButton sx={{ p: '5px', height: '40px', color: '#686869' }}>
                                        <Box sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center', p: '5px', m: '5px' }}>
                                            <StorefrontRoundedIcon sx={{ width: '25px', height: 'auto' }} />
                                            <Typography
                                                sx={{
                                                    '&:hover': { color: 'black' },
                                                    fontSize: 13.5, color: '#686869', fontFamily: 'Open Sans', fontWeight: 300,
                                                    letterSpacing: '.0.5rem', textTransform: 'none'
                                                }}>
                                                Market place
                                            </Typography>
                                        </Box>
                                    </IconButton>
                                    <IconButton sx={{
                                        p: '5px', height: '40px', color: '#686869', '&:hover': {
                                            color: 'black',
                                            '& > *': { color: 'black' },
                                        },
                                    }}>
                                        <Box sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
                                            <Groups2RoundedIcon sx={{ width: '25px', height: 'auto' }} />
                                            <Typography
                                                sx={{
                                                    fontSize: 13.5, color: '#686869', fontFamily: 'Open Sans', fontWeight: 300,
                                                    letterSpacing: '.0.5rem', textTransform: 'none'
                                                }}>
                                                Clubs
                                            </Typography>
                                        </Box>
                                    </IconButton>
                                </Stack>
                                <Divider orientation="vertical" variant="middle" flexItem sx={{ borderRightWidth: 2, height: '40px', alignSelf: 'center', ml: '20px' }} />
                                <Button
                                    ref={joinNowButtonRef}
                                    id="joinNow"
                                    variant="contained"
                                    disableElevation
                                    sx={{
                                        ml: '20px', backgroundColor: '#768A54', borderRadius: '20px', fontSize: 13.5, color: '#ffffff', fontFamily: 'Open Sans', fontWeight: 300,
                                        letterSpacing: '.0.5rem', textTransform: 'none', minWidth: '130px', padding: '5px', '&:hover': { backgroundColor: '#768A54' }
                                    }}
                                >
                                    Join now
                                </Button>
                            </Box>
                            <Tooltip title="Account settings">
                                <IconButton
                                    size="large"
                                    edge="end"
                                    aria-label="account of current user"
                                    aria-controls="menu-appbar"
                                    aria-haspopup="true"
                                    onClick={handleOpenUserMenu}
                                    color="inherit"
                                >
                                    <Avatar sx={{ width: 32, height: 32, bgcolor: '#686869' }} />
                                </IconButton>
                            </Tooltip>
                            <Menu
                                id="menu-appbar"
                                anchorEl={anchorElUser}
                                anchorOrigin={{
                                    vertical: 'bottom',
                                    horizontal: 'right',
                                }}
                                keepMounted
                                transformOrigin={{
                                    vertical: 'top',
                                    horizontal: 'right',
                                }}
                                open={Boolean(anchorElUser)}
                                onClose={handleCloseUserMenu}
                            >
                                {settings.map((setting) => (
                                    <MenuItem key={setting} onClick={handleCloseUserMenu}>
                                        <Typography sx={{ color: '#626262' }}>{setting}</Typography>
                                    </MenuItem>
                                ))}
                            </Menu>
                        </Toolbar>
                    </Box>
                </Container>
            </AppBar>
        );
    }
}
